import { Dialog, Card, Typography } from "@material-ui/core";
import { withStyles } from "@material-ui/core/styles";

const CustomCard = withStyles({
    root: {
      backgroundColor: "#242424",
      width: "100%",
      borderRadius: "15 px",
    },
  })(Card);

const Title = withStyles({
root: {
    color: "#7C3AED",
    display: "inline",
}
})(Typography);

const Text = withStyles({
root: {
    color: "#D1D5DB"
}
})(Typography);

const HelpDialog = withStyles({
  root: {
    "& .MuiDialog-paper":{
      backgroundColor: "#242424",
      color: "#D1D5DB",
      width: "50%",
      height: "50%"
    }
  }
})(Dialog);

export {
    CustomCard,
    Title,
    Text,
    HelpDialog
}
